// src/Navbar.jsx
import { Menu, UserCircle } from "lucide-react";

export default function Navbar() {
  return (
    <nav className="bg-gray-900 text-white shadow-md px-6 py-3 flex items-center justify-between">
      {/* Left: Menu Icon + Logo */}
      <div className="flex items-center gap-4">
        <Menu className="w-6 h-6 cursor-pointer hover:text-blue-400 transition-colors duration-200" />
        <span className="font-bold text-2xl tracking-wide">Doctor APS</span>
      </div>

      {/* Right: Navigation Buttons */}
      <div className="flex items-center gap-4">
        <button className="px-3 py-1 rounded-md hover:bg-gray-700 transition-colors duration-200">
          Dashboard
        </button>
        <button className="px-3 py-1 rounded-md hover:bg-gray-700 transition-colors duration-200 flex items-center gap-1">
          <UserCircle className="w-5 h-5" /> Profile
        </button>
        <button className="px-3 py-1 rounded-md bg-red-600 hover:bg-red-500 transition-colors duration-200">
          Logout
        </button>
      </div>
    </nav>
  );
}
